DOCUMENTARY ABOUT THE SERIES

The Prisoner is an extraordinary TV series that not only entertains but also offers you the chance to philosophise or ponder the human condition. It is highly regarded as one of the most famous, the most acclaimed and most of intriguing of British cult TV adventure series.

Staring Emmy award winner Patrick McGoohan as Number Six. A man removed from his position in a secret organisation and trapped in a nightmare village where his thoughts and movements are controlled by an unknown force- represented by the ever changing Number Two.

A taut psycho-thriller, The Prisoner was highly influential when aired on ITV (UK) in 1967 and 1968 and it remains as relevant and intriguing as ever.

